            console.log("blabla")
            await fetch('http://localhost:8080/load', {
                method: 'POST',
            });

    };

    return (
        <div className="upload-button">
            <input type="file" onChange={handleFileUpload} />
            <button>Upload PDF</button>
        </div>
    );
};

export default UploadButton;
